        <Wrapper>
            <Heading>
                Top Tracks
            </Heading>

        </Wrapper>
    )
const Wrapper = styled.div`
padding-top:24px;
`
const Heading = styled.h2`
font-family:'Source Sans Pro',sans-serif;
color:#390f5e;
font-size:24px;
font-weight:bold;

`
const ListItems = styled.li`
list-style:none;
display:flex;
justify-content:space-between;
margin-bottom:24px;
p{
    color:hsl(0,0%,49%);
}
h3{
    color:hsl(0,0%,45%);
}
`
const TopBar = styled.ol`
padding-right:30px;

`
export default TrackSide;
